import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="App-header">

        <div className="headerleft-wrapper">
          <span className="icon-wrapper"></span>
          <label>Microsoft Teams</label>
        </div>

        <span className="search-wrapper"></span>

        <div className='headerright-wrapper'>
          <span className='settings-wrapper'></span>
          <span className='profile-wrapper'></span>
        </div>
      </div>
    </div>
  );
}

export default App;
